Parameter.Value:
if (FunctionModel=="flat")
{
	write(phyMode, 0x00);
	write(inputMTU, 0x00
	| InputMTU=="3byte" ? 0x03 : 0x00
	| InputMTU=="7byte" ? 0x07 : 0x00
	| InputMTU=="11byte" ? 0x0b : 0x00
	| InputMTU=="15byte" ? 0x0f : 0x00
	| InputMTU=="19byte" ? 0x13 : 0x00
	| InputMTU=="23byte" ? 0x17 : 0x00
	| InputMTU=="27byte" ? 0x1b : 0x00);
	write(outputMTU, 0x00
	| OutputMTU=="3byte" ? 0x03 : 0x00
	| OutputMTU=="7byte" ? 0x07 : 0x00
	| OutputMTU=="11byte" ? 0x0b : 0x00
	| OutputMTU=="15byte" ? 0x0f : 0x00
	| OutputMTU=="19byte" ? 0x13 : 0x00
	| OutputMTU=="23byte" ? 0x17 : 0x00
	| OutputMTU=="27byte" ? 0x1b : 0x00);
	write(forward, BlockForward);
	write(forwardDelay, BlockForwardDelay);
	write(mode, 0x00
	| MultibleSegments=="on" ? 0x01 : 0x00
	| SegmentsLongerMTU=="on" ? 0x02 : 0x00);
	write(phyBaud, Baudrate);
	write(phyData, DataBits);
	write(phyStop, StopBits<<1);
	write(phyParity, 0x00
	| Parity=="N" ? 0x4e : 0x00
	| Parity=="E" ? 0x45 : 0x00
	| Parity=="O" ? 0x4f : 0x00
	| Parity=="H" ? 0x31 : 0x00
	| Parity=="L" ? 0x30 : 0x00);
	write(rxlLock, UpperThreshold);
	write(rxlUnlock, LowerThreshold);
	write(rxCto, ReceiveIdleTime);
	write(rxEomSize, RxFrameLengthMax);
	write(rxEomChar0, RxFrameTerminationChar1);
	write(rxEomChar1, RxFrameTerminationChar2);
	write(rxEomChar2, RxFrameTerminationChar3);
	write(rxEomChar3, RxFrameTerminationChar4);
	write(txlLock, TxBufferSize);
	write(txlUnlock, 0);
	write(txCto, TransmitIdleTime);
	write(txEomSize, TxFrameLengthMax);
	write(txEomChar0, TxFrameTerminationChar1);
	write(txEomChar1, TxFrameTerminationChar2);
	write(txEomChar2, TxFrameTerminationChar3);
	write(txEomChar3, TxFrameTerminationChar4);
	write(hshInv, 0x00);
	write(hshTxF, 0x00);
	write(hshClr, 0x00);
	write(hshSet, 0x00);
	write(hshRxF, 0x00);
	write(hshFrm, 0x00);
	write(hssXOn, 0x0000
	| SwHandshakeActivate=="on" ? SwHandshakeXonChar : 0xffff);
	write(hssXOff, 0x0000
	| SwHandshakeActivate=="on" ? SwHandshakeXoffChar : 0xffff);
	write(hssPeriod, SwHandshakePeriod);
	write(phyMode, 0x00
	| DeviceType=="RS422" ? 0x04 : 0x00
	| DeviceType=="RS422BUS" ? 0x05 : 0x00
	| DeviceType=="RS485TxE" ? 0x06 : 0x00
	| DeviceType=="RS485" ? 0x07 : 0x00);
	if (ExtErrStatusInfo=="on")
	{
		write(CfO_ErrorID0007, 0x0F);
	}
}
if (FunctionModel=="Stream1xRS4xx")
{
	if (ExtErrStatusInfo=="on")
	{
		write(CfO_ErrorID0007, 0x0F);
	}
}
if (FunctionModel=="StreamCyc1xRS4xx")
{
	write(inputMTU, 0x1b);
	write(outputMTU, 0x1b);
	write(mode, 0x03);
	write(forward, 0x07);
	if (ExtErrStatusInfo=="on")
	{
		write(CfO_ErrorID0007, 0x0F);
	}
}
if (FunctionModel=="CANIOBusController")
{
	write(phyMode_CANIO, 0x00);
	write(inputMTU, 0x00
	| InputMTU=="7byte" ? 0x07 : 0x00);
	write(outputMTU, 0x00
	| OutputMTU=="7byte" ? 0x07 : 0x00);
	write(forward, BlockForward);
	write(forwardDelay, BlockForwardDelay);
	write(mode, 0x00
	| MultibleSegments=="on" ? 0x01 : 0x00
	| SegmentsLongerMTU=="on" ? 0x02 : 0x00);
	write(phyBaud_CANIO, Baudrate);
	write(phyData_CANIO, DataBits);
	write(phyStop_CANIO, StopBits<<1);
	write(phyParity_CANIO, 0x00
	| Parity=="N" ? 0x4e : 0x00
	| Parity=="E" ? 0x45 : 0x00
	| Parity=="O" ? 0x4f : 0x00
	| Parity=="H" ? 0x31 : 0x00
	| Parity=="L" ? 0x30 : 0x00);
	write(rxlLock_CANIO, UpperThreshold);
	write(rxlUnlock_CANIO, LowerThreshold);
	write(rxCto_CANIO, ReceiveIdleTime);
	write(rxEomSize_CANIO, RxFrameLengthMax);
	write(rxEomChar0_CANIO, RxFrameTerminationChar1);
	write(rxEomChar1_CANIO, RxFrameTerminationChar2);
	write(rxEomChar2_CANIO, RxFrameTerminationChar3);
	write(rxEomChar3_CANIO, RxFrameTerminationChar4);
	write(txlLock_CANIO, TxBufferSize);
	write(txlUnlock_CANIO, 0);
	write(txCto_CANIO, TransmitIdleTime);
	write(txEomSize_CANIO, TxFrameLengthMax);
	write(txEomChar0_CANIO, TxFrameTerminationChar1);
	write(txEomChar1_CANIO, TxFrameTerminationChar2);
	write(txEomChar2_CANIO, TxFrameTerminationChar3);
	write(txEomChar3_CANIO, TxFrameTerminationChar4);
	write(hshInv_CANIO, 0x00);
	write(hshTxF_CANIO, 0x00);
	write(hshClr_CANIO, 0x00);
	write(hshSet_CANIO, 0x00);
	write(hshRxF_CANIO, 0x00);
	write(hshFrm_CANIO, 0x00);
	write(hssXOn_CANIO, 0x0000
	| SwHandshakeActivate=="on" ? SwHandshakeXonChar : 0xffff);
	write(hssXOff_CANIO, 0x0000
	| SwHandshakeActivate=="on" ? SwHandshakeXoffChar : 0xffff);
	write(hssPeriod_CANIO, SwHandshakePeriod);
	write(phyMode_CANIO, 0x00
	| DeviceType=="RS422" ? 0x04 : 0x00
	| DeviceType=="RS422BUS" ? 0x05 : 0x00
	| DeviceType=="RS485TxE" ? 0x06 : 0x00
	| DeviceType=="RS485" ? 0x07 : 0x00);
	if (ExtErrStatusInfo=="on")
	{
		write(CfO_ErrorID0007, 0x0F);
	}
}

